De leeuw Alex (Ben Stiller), de zebra Marty (Chris Rock), de giraffe Melman (David Schwimmer) en het nijlpaard Gloria 
(Jada Pinkett Smith) zijn druk bezig met hun laatste poging om terug te geraken naar New York. Dit willen ze bereiken door zich 
aan te sluiten bij een rondreizend circus. Een dierenvanger (Frances McDormand) loopt echter rond om het het viertal lastig te 
maken.
